scriptlet.script:
/*
 Target: server.scvmm.vm.inventory.path = /vmSCVMMClusterName/vmSCVMMName_vmSCVMMName
*/

vmSCVMMName = scriptletContext.getLocal("server.hostname"); 
vmSCVMMClusterName = scriptletContext.getLocal("clusterName"); 
serverSCVMMVmInventoryPath = "/" + vmSCVMMClusterName + "/" + vmSCVMMName + "_" + vmSCVMMName;
scriptletContext.put("server.scvmm.vm.inventory.path", serverSCVMMVmInventoryPath);

/*
 Target: server.vm.inventory.path = vm://${vmHostIP}/vmfs/volumes/${dataStore}/${vmxPath}
*/

vmHostIP = scriptletContext.getLocal("vmHostIP"); 
dataStore = scriptletContext.getLocal("server.vm.dataStore"); 
vmxPath = scriptletContext.getLocal("server.vm.vmxPath"); 
serverVmInventoryPath = "vm://" + vmHostIP + "/vmfs/volumes/" + dataStore + "/" + vmxPath;
scriptletContext.put("server.vm.inventory.path", serverVmInventoryPath);
